import React from 'react'
import arrow_icon from '../Assets/breadcrum_arrow.png'

const BreadCrum = (props) => {
    const {product} =props;
  return (
    <div>
        HOME <img src={arrow_icon} alt=""></img> SHOP <img src={arrow_icon} alt=""/> {product.category} <img src={arrow_icon} alt=""/> {product.name}
    </div>
  )
}

export default BreadCrum
